class Solution:
    def solution(self, stdin: str) -> str:
        n, m = map(int, stdin.split())
        beautiful = []
        for _ in range(m):
            a, b = map(int, input().split())
            if a > 0 and b > 0:
                beautiful.append((a, b))

        max_money = 0
        for i in range(n):
            for j in range(i + 1, n + 1):
                if beautiful[i-1][0] == j and beautiful[i-1][1] == j:
                    max_money = max(max_money, beautiful[i-1][0] * beautiful[i-1][1])

        return str(max_money)

